import React, { useEffect, useState, useMemo, useRef } from "react";

//자체 컴포넌트
import MainBar from "../components/GatherRoomPageCom/MainBar";
import NaviBar from "../components/GatherRoomPageCom/NaviBar";
import PlayMap from "../components/GatherRoomPageCom/PlayMap";
import SideBar from "../components/GatherRoomPageCom/SideBar";
import AllCam from "../components/GameRoomPageCom/AllCam";

//mui 컴포넌트
import Grid from "@mui/material/Grid";
import Container from "@mui/material/Container";
import Paper from "@mui/material/Paper";

const GatherRoom = () => {
  const [IsGameStart, setIsGameStart] = useState(false);
  const [Data, setData] = useState([1]);
  const Data2 = useRef([1]);
  return (
    <Container>
      <Grid container spacing={2}>
        <Grid item xs={8}>
          <Grid>
            <Paper elevation={3}>
              <MainBar />
            </Paper>
          </Grid>
          <Grid>{/* <Paper elevation={3}>{IsGameStart ? <AllCam /> : <PlayMap />}</Paper> */}</Grid>
        </Grid>
        <Grid item xs={4}>
          <Grid>
            <Paper elevation={3} style={{ height: 50 }}>
              <NaviBar IsGameStart={IsGameStart} setIsGameStart={setIsGameStart} />
            </Paper>
          </Grid>
          <Grid>
            <Paper elevation={3}>{/* <SideBar /> */}</Paper>
          </Grid>
          <Grid>
            <button onClick={() => setData([...Data, 1])}>
              useState 클릭하면 다시 랜더링될까?
            </button>
            <button onClick={() => (Data2.current = [...Data2.current, 1])}>
              useRef 클릭하면 다시 랜더링될까?
            </button>
            <Test Data={Data} Data2={Data2.current} />
          </Grid>
        </Grid>
      </Grid>
    </Container>
  );
};

const Test = (props) => {
  console.log("props.Data2: " + props.Data2);
  console.log("props.Data: " + props.Data);
  return <>{props.Data}</>;
};

export default GatherRoom;
